def process_hex_list(hex_list):
    result = []
    x_sum = 0
    y_sum = 0

    for i, value in enumerate(hex_list):
        # Somma i primi 4 valori nella parte superiore
        if i % 8 < 4:
            x_sum += value
        else:
            # Somma gli ultimi 4 valori nella parte inferiore
            y_sum += value
        
        # Ogni 8 valori, aggiungi la coppia (x_sum, y_sum) all'array risultante
        if (i + 1) % 8 == 0:
            result.append((x_sum, y_sum))
            # Resetta le somme per il prossimo gruppo di 8 valori
            x_sum = 0
            y_sum = 0

    return result


